import './App.css';
import Header from './Header';
import About from './About';
import Category from './Category';
import Home from './Home';
import Footer from './Footer';
import Error from './Error';
import CategoryDescription from './CategoryDescription';


import { BrowserRouter as Router, Switch, Route } from 'react-router-dom';

function App() {
  return (
    <>
      <Header />
      <Router>
        <nav>
          <li><Link to='/'>Home</Link></li>
          <li><Link to='/about'>About</Link></li>
          <li><Link to='/cat'>Category</Link></li>
        </nav>
        <Switch>
          <Route exact path="/" component={Home} />
          <Route exact path="/about" component={About} />
          <Route exact path="/cat/:nameCat" component={CategoryDescription} />
          <Route exact path="/cat/notebook" component={Category} />
          <Route exact path="/cat/monitor" component={Category} />
          <Route exact path="/cat/cellphone" component={Category} />
          <Route exact path="/cat" component={Category} />
          <Route component={Error} />
        </Switch>
      </Router>
      <Footer />
    </>
  );
}

export default App;
